      | 365364 -> { ItemTypeData.id= 365364; name= "Estoc"; published= false; description= "Conceived as the “ultimate urban pacifier”, in practice the Medium Attack Vehicle is that and more – having inherited the strengths of its forebears, and few of their weaknesses. Its anti-personnel weaponry make it the perfect tool for flushing out insurgents, while the ample armor it carries means that it can withstand multiple direct hits and still keep coming. Though somewhat less effective on an open battlefield, its success rate in urban environments has earned the MAV almost legendary status among the troops it serves."; marketGroupId= None; groupId= 351210; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 1.000000; volume= 0.000000 } |> Some
