      | 366431 -> { ItemTypeData.id= 366431; name= "Imperial Scrambler Pistol"; published= false; description= "The Scrambler is a semi-automatic pistol originally designed and manufactured by Carthum Conglomerate. A small-scale directed energy weapon, it produces a laser-induced plasma channel capable of dealing short-range pin-point damage to a target.  Power consumption is excessive, but is addressed via a rear-loaded fuel cell, allowing cells to be exchanged quickly and easily once exhausted. Moreover, advances in the polymers used in the weapon's construction have greatly reduced heat build-up and improved heat dissipation, resulting in improved reliability over earlier modules. "; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366528 -> { ItemTypeData.id= 366528; name= "State KIN-012 Nanite Injector"; published= false; description= "The nanite injector delivers an active helix directly into the bloodstream of the downed victim, whereupon individual subunits work to suppress the pain response, repair tissue and organ damage and reestablish regular cardiac rhythm. If administered in time, first-phase resuscitation (defined as ‘minimum-essential combat functionality') is typically achievable, though some psychological trauma is to be expected."; marketGroupId= None; groupId= 351844; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366722 -> { ItemTypeData.id= 366722; name= "'Neo' Commando M-I"; published= false; description= "The Commando dropsuit is a variable combat unit capable of reacting to battlefield threats as they emerge. Built using a repurposed heavy frame, the suit is designed for maximum offensive flexibility. The streamlined frame does away with extraneous armor layers, using the augmented power of the exoskeleton to instead shoulder the weight and bulk of two light-class weapons.    Stripped of all but the most necessary protection, the Minmatar Commando is the fastest, most agile heavy frame on the battlefield. Jury-rigged into the subframe are off-the-shelf damage modifiers able to improve the damage yield of all light-class projectile and explosive weaponry wielded by the user.    The Commando is the ultimate suppression fighter. What the suit sacrifices in tactical versatility, it more than makes up for with flexible weapon loadouts that can counter any of the myriad threats an ever-evolving battlefield may present."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
