      | 4330 -> { ItemTypeData.id= 4330; name= "Research Abstract: Project Omicron"; published= true; description= "<b>Paper:</b> Project Omicron<br>  <b>Lead Researcher:</b> Authochthonian<br>  <b>Contributors:</b> Authochthonian, Chevalleis, Grideris<br>  <b>Summary:</b> Project Omicron is an attempt to establish two-way communications with the rogue drones. The purpose of this attempt is to find common ground as a prelude to full diplomatic negotiations and to find out as much information as possible on their origins, purpose and needs. Additionally, Omicron aims to investigate possible connections between rogue drones and sleeper drones by communicating directly with rogue drone hives where possible. Much of this project relates to others, such as <a href=showinfo:4320>Project Theta</a>, which seeks to provide the hardware to make such communication possible.     Two-way communications with rogue drones have been proven possible (see the Algintal Incident) and we are constantly refining our communication protocols and encryption/decryption techniques to improve our communication abilities. We predict, based on current evidence, that full communication with rogue drones may be possible around late YC 113 to early YC 114.       <i>This abstract relates to research undertaken by the Arek'Jaalan Project.</i>    <i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>    <i>Further copies of this document can be obtained through the Arek'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>"; marketGroupId= None; groupId= 1141; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
