      | 48950 -> { ItemTypeData.id= 48950; name= "Log Fragment 1 (Gala YC121)"; published= true; description= "121.02.07 09:06.12  To: global.faction    It has come to my attention that many of you are understandably concerned about the potential for a repeat of last year's interruptions. I would like to assure everyone that we have taken every possible precaution to ensure the sanctity of the event. The Gala has an increased security complement and has been relocated to more discreet pockets of space. This year promises to be our most secure, and dare I say most fun, event ever.    For those of you whose fears have not been allayed, I offer you my personal guarantee that I will not allow for a repeat of last year’s debacle. I would also like to remind you of our standard biomass policy regarding dissent.    Your grateful host,     O.H"; marketGroupId= Some(1661); groupId= 1194; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.010000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
