      | 49435 -> { ItemTypeData.id= 49435; name= "Astero Deathglow Hunters SKIN"; published= true; description= "The substance nicknamed 'Deathglow' can be obtained by refining a rare mineral obtained from asteroids that have been altered by the strange gravitational and electromagnetic effects of certain deadspace pockets lying in the zones between 'shallow', stable deadspace and the truly twisted depths of abyssal deadspace.    The Deathglow Hunters are notorious criminals and partake of frenzied rituals using the substance. Recent intelligence suggests the Deathglow gangs are largely affiliated with the Blood Raider Covenant, a development that may indicate a desire on the part of the Blood Raiders to expand their operations into the drugs and boosters trade."; marketGroupId= Some(2031); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
