      | 49823 -> { ItemTypeData.id= 49823; name= "Aeon Lavacore Imperial SKIN"; published= true; description= "The Amarr Empire has been exploiting lava planets for the rich resources to be had from the constant churn of magma for ages past. The vast territories controlled by the Amarr contain hundreds of such planets and the expertise of their planetary extraction engineers in the field of lava planet mining is well known across New Eden.    Empress Catiz I's own family, House Tash-Murkon, has considerable interests in the mining industries and is noted for its extensive harvesting of resources from the many lava planets it directly controls through its regional fief. The  Lavacore Imperial  nanocoating is testament to the flaming riches of the Amarr Empire's lava planets and the vast wealth that the Empress herself has derived from such worlds."; marketGroupId= Some(1974); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 50017 -> { ItemTypeData.id= 50017; name= "Paradise Club"; published= false; description= "<b>Note: Gala patrons should present their ticket and deposit at check in to receive their Gala Surprise Gift from the Angel Cartel.</b>    The Paradise Club is the center of the Guardian's Gala YC121 celebrations. As elite attendees you will be pampered and entertained by a legion of servants, dancers, chefs, sommeliers, pharma-vendors, gladiators, robot comedians (a big hit in the Syndicate this year), performing loons, hired ranters, poets, fighting bantam cocks and so many, many more dazzling delights.     The Serpentis Corporation spares no expense in welcoming partners and clients, one and all, to the Guardian's Gala!    <b>WARNING: Anyone found on station without an invitation will be made to run the cyber-slaver hound gauntlet. (Hounds provided by kind donation of Zashev Human Resources Extraction Services.)</b>"; marketGroupId= None; groupId= 226; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= Some(22367); mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 16000.000000; volume= 0.000000 } |> Some
