      | 52442 -> { ItemTypeData.id= 52442; name= "Damavik Red Forests Thunderbird SKIN"; published= true; description= "A flurry of swirling snow, dappling an abstract pattern of red drops merging, or perhaps flowing from woods presided over by an ancient spirit. The Gallente artist responsible for this design hails from the deep woods of the mountainous Eastern archipelago of the Morthane continent on Luminaire. Now controlled by the Morthane Mountain Islands Commonwealth, also known as the Grognard Commonwealth, the area is well-known across the Gallente home planet for its tradition of opposing Federated Union rule.    The Grognard Commonwealth is also famed for producing many eccentric artists, some notable revolutionaries and a goodly harvest of the sweet, sticky syrup produced from the sap of the Red Coin Tree. Oddly enough, the area has also become a favorite home for significant numbers of Mannar retirees from the Federal military, adding to an atmosphere of considerable diversity and independent thinking."; marketGroupId= Some(2486); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
